import React from 'react';
import ReactDOM from 'react-dom/client'; 
import App from './App';
import './index.css'; 
import { Toaster } from "./components/ui/toaster"

// Create the root element for rendering
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Toaster />
  </React.StrictMode>
);
